  return (
    <div className="body">
      <div className="card" >
        <div className="card-body">
          <h5 className="card-title">Admin Panel</h5>
          <h6 className="card-subtitle mb-2 text-muted">Enter subtitle</h6>
          <input type="text" />
        </div>
      </div>
    </div>
  );
}
